import React from 'react';
import { BrowserRouter, NavLink, Route, Router } from 'react-router-dom';

function ListUsersItem({ user }) {
    return (
        <>
            <BrowserRouter>
                <nav>
                    <NavLink to={'/album'}><li>{user.name}</li></NavLink>
                </nav>

                <Router>

                    <Route path="/album" />
                </Router>
            </BrowserRouter>
        </>
    );
}

export default ListUsersItem;
